'''
3. Longest Substring Without Repeating Characters
Medium

Given a string s, find the length of the longest substring without repeating characters.



Example 1:

Input: s = "abcabcbb"
Output: 3
Explanation: The answer is "abc", with the length of 3.

Example 2:

Input: s = "bbbbb"
Output: 1
Explanation: The answer is "b", with the length of 1.

Example 3:

Input: s = "pwwkew"
Output: 3
Explanation: The answer is "wke", with the length of 3.
Notice that the answer must be a substring, "pwke" is a subsequence and not a substring.



Constraints:

    0 <= s.length <= 5 * 104
    s consists of English letters, digits, symbols and spaces.


'''

def distinct(s):
    map = {}

    for c in s:

        if c in map :
            return False
        map[c] = 1

    return True


class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        #IF WE HAE SEEN THE STRING BEFORE IT IS NOT UNIQUE (CHECK MAP)
        check_map = {}
        length = len(s)
        rslt = 0
        for i in range(length):
            for j in range(i, length):
                sub = s[i:j+1]
                if sub not in check_map:
                    check_map[sub] = 1
                    if distinct(sub):
                       rslt = max(rslt, len(sub))
                    #IF IT HAS NONE DISTINCT CHARS THEN ALL FUTURE STRINGS STARTING AT I ALSO ARE NOT DISTINCT SO SKIP AHEAD
                    else:
                        break

        return rslt


obj = Solution()

print(obj.lengthOfLongestSubstring(" "))

print(obj.lengthOfLongestSubstring("abcabcbb"))

print(obj.lengthOfLongestSubstring("bbbbb"))

print(obj.lengthOfLongestSubstring("pwwkew"))

